import { Route } from "react-router-dom";
import { Fragment } from "react";
import Welcome from "./components/Welcome";

function App() {
  return (
    <div>
      <Fragment>
        <Route path='/welcome'>
          <Welcome></Welcome>
        </Route>
        <Route path='/products'>
          <Welcome></Welcome>
        </Route>
      </Fragment>
    </div>
  );
}

export default App;
